<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Get Lumina</title>
    <style>
        body {
            background-color: white;
            font-family: Arial, sans-serif;
            margin: 0;
        }
        header {
            background-color: #04162b;
            color: #6b6b6b;
            text-align: center;
            padding: 20px;
            font-size: 24px;
            font-weight: bold;
        }
        button {
            padding: 10px 20px;
            font-size: 16px;
            cursor: pointer;
            border: 1px solid #ccc;
            background-color: white;
        }
        .container {
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            flex-direction: column;
        }
        .keybind-box {
            background-color: #f9f9f9;
            padding: 15px;
            margin-top: 20px;
            width: 300px;
            border: 1px solid #ccc;
            text-align: center;
        }
        .keybind-box h2 {
            font-size: 20px;
            margin: 0;
        }
        .keybind-box hr {
            border: none;
            border-top: 1px solid #ccc;
            margin: 10px 0;
        }
        .keybind-list {
            font-size: 16px;
            line-height: 1.5;
        }
    </style>
</head>
<body>

<header>
    Website Redesign/Maintenance Soon
</header>

<div class="container">
    <button id="copyButton">Copy Script</button>
    
    <div class="keybind-box">

            <p>(C) Speed</p>
            <p>(E) Camlock</p>
            <p>(T) Cursor TP</p>
            <p>(G) Orbit</p>
        </div>
    </div>
</div>
